import React, { useState } from 'react';
import { BrowserRouter as Router, Route, Switch} from 'react-router-dom';
import HomePage from './components/homepage.js';
import Dashboard from './components/Dashboard.js';
import GradeReportPage from './components/GradeReportPage.js';
import MissingGradeFormPage from './components/MissingGradeFormPage.js';
import InstructorContactPage from './components/InstructorContactPage.js';
import LoginPage from './components/LoginPage';
import HelpAndSupportPage from './components/HelpAndSupportPage.js';

const App = () => {
  const [currentPage, setCurrentPage] = useState('homepage');

  const handlePageChange = (pageName) => {
    setCurrentPage(pageName);
  };

  return (
    <Router>
      {/* Your navigation bar or any other component for changing pages */}
      <nav>
        <button onClick={() => handlePageChange('homepage')}>Home</button>
        <button onClick={() => handlePageChange('dashboard')}>Dashboard</button>
        {/* Add buttons or links for other pages */}
      </nav>

      {/* Use Switch to render only the first Route that matches */}
      <Switch>
        <Route path="/homepage" component={HomePage} />
        <Route path="/dashboard" component={Dashboard} />
        <Route path="/grade-reporting" component={GradeReportPage} />
        <Route path="/missing-grades" component={MissingGradeFormPage} />
        <Route path="/instructor-contact" component={InstructorContactPage} />
        <Route path="/LoginPage" component={LoginPage} />
        <Route path="/HelpAndSupportPage" component={HelpAndSupportPage} />
        {/* Add more routes as needed */}
      </Switch>

      {/* Conditional rendering based on state */}
      {currentPage === 'homepage' && <HomePage />}
      {currentPage === 'dashboard' && <Dashboard />}
      {/* Add more conditions for other pages */}
    </Router>
  );
};

export default App;
